import React, { useState } from 'react';
import './Chatbot.css';

const Chatbot = () => {
  const [messages, setMessages] = useState([]);
  const [query, setQuery] = useState('');
  const [loading, setLoading] = useState(false);
  const [searchEnabled, setSearchEnabled] = useState(false);

  const handleToggle = () => {
    setSearchEnabled(!searchEnabled);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    const userMessage = { sender: 'user', text: query };
    setMessages([...messages, userMessage]);

    if (searchEnabled) {
      const [companyResponse, gptResponse] = await Promise.all([
        fetch('http://localhost:8000/getApi', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ query })
        }).then(res => res.json()),
        fetch('http://localhost:8000/getResponse', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ query })
        }).then(res => res.json())
      ]);

      const botMessage = {
        sender: 'bot',
        company: formatCompanyResponse(companyResponse),
        openAi: gptResponse.response
      };

      setMessages([...messages, userMessage, botMessage]);
    } else {
      const response = await fetch('http://localhost:8000/getResponse', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ query })
      });

      const data = await response.json();
      const parts = data.response.split(" ");
      let openAiResponse = "";

      for (let i = 0; i < parts.length; i++) {
        setTimeout(() => {
          openAiResponse += parts[i] + " ";
          const botMessage = {
            sender: 'bot',
            company: null,
            openAi: openAiResponse
          };
          setMessages((prevMessages) => [...prevMessages.slice(0, -1), botMessage]);
        }, i * 100);  // Adjust the speed by changing the timeout duration
      }
    }

    setQuery('');
    setLoading(false);
  };

  const formatCompanyResponse = (response) => {
    if (response.data && response.data.response_text) {
      const text = response.data.response_text.replace(/\n/g, '<br/>');
      const urls = response.data.web_url.map(url => `<a href="${url}" target="_blank">${url}</a>`).join('<br/>');
      return `${text}<br/><br/>Sources:<br/>${urls}`;
    }
    return JSON.stringify(response);
  };

  return (
    <div className="chatbot">
      <div className="chat-window">
        {messages.map((msg, index) => (
          <div key={index} className={`message ${msg.sender}`}>
            {msg.sender === 'bot' ? (
              <div className="message-content bot-message" dangerouslySetInnerHTML={{ __html: `<p><strong>Company Response:</strong><br/>${msg.company}</p><p><strong>OpenAI Response:</strong><br/>${msg.openAi}</p>` }} />
            ) : (
              <div className="message-content user-message">
                <strong>User:</strong> {msg.text}
              </div>
            )}
          </div>
        ))}
        {loading && <p className="loading">Loading...</p>}
      </div>
      {!loading && (
        <>
          <div className="toggle-container">
            <label className="toggle-label">Enable Search</label>
            <label className="toggle-switch">
              <input type="checkbox" checked={searchEnabled} onChange={handleToggle} />
              <span className="slider"></span>
            </label>
          </div>
          <form onSubmit={handleSubmit} className="chat-input">
            <input
              type="text"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              placeholder="Type your message..."
            />
            <button type="submit">Send</button>
          </form>
        </>
      )}
      <footer className="footer">
        <p>Made by Vishanth hearsymbol</p>
      </footer>
    </div>
  );
};

export default Chatbot;
